row.value:
Il risultato determina il titolo da visualizzare per questa finestra, utilizzata anche come etichetta per Elementi recenti.
Il formato è solo una o più variabili di contesto circondate da @, esempi:
@TaxID@
@DocumentNo@
@Value@ @Name@
se questo campo viene lasciato vuoto, viene creato un titolo/etichetta predefinito utilizzando i campi DocumentNo, Value e Name se esistono.

value.original:
OpenID Connect authority URL, some well know URL format:
Keycloak: {server host name or IP}/realms/{realm name}
Amazon Cognito: https://cognito-idp.{Region}.amazonaws.com/{your user pool ID}
Azure: https://login.microsoftonline.com/{tenant}/v2.0

